textOriginal:
MOURÃO foi um saco de pancada do BOLSONARO:
- Mourão não exigiu respeito do Bolsonaro;
- Bolsonaro desautorizou Mourão por fala sobre Ucrânia;
- Bolsonaro: "Mourão atrapalha, mas vice é como cunhado, tem que aturar";
- Mourão: “Não há conversas seguidas entre nós. As conversas são bem esporádicas”;
- Mourão: disse que sua relação com o presidente Jair Bolsonaro não é "simples".

Agora Mourão quer falar grosso sobre Alexandre de Moraes.
